        [TestMethod]
        public void JacobiSNTest()
        {
            IEnumerable<TestCase<double, double>> GetSN(JacobiData[] data)
            {
                return data.Select(d => TestCase.Create(d.K, d.U, d.SN));
            }

            TestCaseSet<double, double>[] testCases = {
                new TestCaseSet<double, double>(GetSN(data1), "JacobiSN Elliptic: Mathworld Data", 800),
                new TestCaseSet<double, double>(GetSN(jacobi_elliptic), "JacobiSN Elliptic: Random Data", 100),
                new TestCaseSet<double, double>(GetSN(jacobi_elliptic_small), "JacobiSN Elliptic: Random Small Values", 100),
                new TestCaseSet<double, double>(GetSN(jacobi_near_1), "JacobiSN Elliptic: Modulus near 1", 500),
                new TestCaseSet<double, double>(GetSN(jacobi_large_phi), "JacobiSN Elliptic: Large Phi", 70000),
            };

            NumericFunctionTest.RunSet(Math2.JacobiSN, "JacobiSN", testCases);

        }

